<!DOCTYPE html>
<html lang="en">
{% load static %}
<!-- Mirrored from demo.naksoid.com/elephant-v1.3.0/theme-1/blank-page.html by HTTrack Website Copier/3.x [XR&CO'2014], Fri, 17 Nov 2017 09:18:46 GMT -->
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <title>智慧城市测试小工具平台</title>
    <meta name="viewport" content="width=device-width,initial-scale=1,user-scalable=no">
    <meta name="description"
          content="Elephant is a front-end template created to help you build modern web applications, fast and in a professional manner.">
    <link rel="apple-touch-icon" sizes="180x180" href="apple-touch-icon.png">
    <link rel="icon" type="image/png" href="{% static 'web/favicon-32x32.png' %}" sizes="32x32">
    <link rel="icon" type="image/png" href="{% static 'web/favicon-16x16.png" sizes="16x16' %}">
    <link rel="manifest" href="manifest.json">
    <link rel="mask-icon" href="safari-pinned-tab.svg" color="#d9230f">
    <meta name="theme-color" content="#ffffff">
    <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Roboto:300,400,400italic,500,700">
    <link rel="stylesheet" href="{% static 'web/css/vendor.min.css' %}">
    <link rel="stylesheet" href="{% static 'web/css/elephant.min.css' %}">
    <link rel="stylesheet" href="{% static 'web/css/application.min.css' %}">
    {% block header %} {% endblock %}
</head>
<body class="layout layout-header-fixed">
{% include 'web/layout-header.html' %}
<div class="layout-main">
    {% include 'web/layout-sidebar.html' %}
    <div class="layout-content">
        <div class="layout-content-body" style="background: #eeeeee57">
            {% block content %} {% endblock %}
        </div>
    </div>
    <div class="layout-footer">
        <div class="layout-footer-body">
            <small class="version">Version 1.3.0</small>
            <small class="copyright">2017 &copy; 科大讯飞-测试-胡鹏</small>
        </div>
    </div>
</div>
<script src="{% static 'web/js/vendor.min.js' %}"></script>
<script src="{% static 'web/js/elephant.min.js' %}"></script>
<script src="{% static 'web/js/application.min.js' %}"></script>
<script src="{% static 'web/js/demo.min.js' %}"></script>
<script src="{% static 'web/js/ajaxClient.js' %}"></script>
{% block tail %} {% endblock %}
</body>

<!-- Mirrored from demo.naksoid.com/elephant-v1.3.0/theme-1/blank-page.html by HTTrack Website Copier/3.x [XR&CO'2014], Fri, 17 Nov 2017 09:18:46 GMT -->
</html>
